import React from 'react';

const Gallery=()=>{
    return(
        <>
        <div className="my-5">
        <h1 className="text-center">Memories</h1>
        </div>
        <div className="container contact_div">
        <div className="row">
        <div className="col-md-6 col-10 mx-auto"></div>
        </div>
        </div>
        </>
    ); 
};


export default Gallery;
